t with DNI 20100100 as co-owner\n    Then The account should have 1 co-owner/s\n    And The client with DNI 20100100 should be a co-owner of the account\n    And The client with DNI 20100100 should have 1 related account/s\n\n  Scenario: Successfully setting various co-owners when creating a new account\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", with client of DNI 11222333 as owner and created by branch 1\n    And A client with DNI 20100100, surname \"Garcia\", name \"Daisy\", born on \"2000-10-15\" and with address \"Cortina 223\"\n    And A client with DNI 19700900, surname \"Simpson\", name \"Mark\", born on \"1999-02-13\" and with address \"Av. Lope de Vega 1071\"\n    When I set the client with DNI 20100100 as co-owner\n    And I set the client with DNI 19700900 as co-owner\n    Then The account should have 2 co-owner/s\n    And The client with DNI 20100100 should be a co-owner of the account\n    And The client with DNI 20100100 should have 1 related account/s\n    And The client with DNI 19700900 should be a co-owner of the account\n    And The client with DNI 19700900 should have 1 related account/s\n\n  Scenario: Owner cannot be co-owner\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", with client of DNI 11222333 as owner and created by branch 1\n    When I try to set the client with DNI 11222333 as co-owner\n    Then The operation should be denied\n\n  Scenario: Account may have no co-owners\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client ation\n\n  Scenario: Successfully create an account with default balance\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", with client of DNI 11222333 as owner and created by branch 1\n    Then The account balance should be 0.0\n\n  Scenario: Successfully create an account with an initial balance\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", balance of 500.0, with client of DNI 11222333 as owner and created by branch 1\n    Then The account balance should be 500.0\n\n  Scenario: Cannot create an account with negative CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    When I try to create an account with CBU -1, alias \"iAmAccount\", with client of DNI 11222333 as owner and created by branch 1\n    Then The operation should be denied\n  \n  Scenario: Cannot create an account with zero CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    When I try to create an account with CBU 0, alias \"iAmAccount\", with client of DNI 11222333 as owner and created by branch 1\n    Then The operation should be denied\n\n  Scenario: Cannot create an account with already existent CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And p":{"seconds":1730921747,"nanos":27349218}}},{"testStepFinished":{"testCaseStartedId":"e3583d4d-9494-4a2e-baa1-6c5874867c5a","testStepId":"0ddde17f-65fb-40a0-8a40-2a024565d916","testStepResult":{"duration":{"seconds":0,"nanos":44463},"status":"PASSED"},"timestamp":{"seconds":1730921747,"nanos":27393681}}},{"testCaseFinished":{"testCaseStartedId":"e3583d4d-9494-4a2e-baa1-6c5874867c5a","timestamp":{"seconds":1730921747,"nanos":27438395},"willBeRetried":false}},{"source":{"uri":"file:///workspaces/2024_2C_109741_Ejercicio1/MeMo1-Ejercicio1/app/src/test/resources/memo1/ejercicio1/client-information-modification.feature","data":"Feature: Modifying client information\n \n    Scenario: Successfully modify client name\n        Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n        And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n        When I change the name of the client to \"Humberto\"\n        Then The name of the client should be \"Humberto\"\n    \n    Scenario: Successfully modify client surname\n        Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n        And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n        When I change the surname of the client to \"Donogan\"\n        Then The surname of the client should be \"Donogan\"\n\n    Scenario: Successfully modify client address\n        Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n        And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n        When I change the address of the client to \"Av. Lavalle 2650\"\n        Then The address of the client should be \"Av. Lavalle 2650\"\n\n    Scenario: Successfully register marriage between two clients and both of them are married\n        Given A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n        And A client with DNI 20100100, surname \"Garcia\", name \"Daisy\", born on \"2000-10-15\" and with address \"Cortina 223\"\n        When I register a new marriage on date \"2024-01-01\" between DNI 11222333 and DNI 20100100\n        Then The date of the marriage should be \"2024-01-01\"\n        And The client with DNI 11222333 should be married to the client with DNI 20100100\n        And The client with DNI 20100100 should be married to the client with DNI 11222333\n\n    Scenario: Two clients are not married\n        Given A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n        And A client with DNI 20100100, surname \"Garcia\", name \"Daisy\", born on \"2000-10-15\" and with address \"Cortina 223\"\n        Then The client with DNI 11222333 should not be married to the client with DNI 20100100\n        Then The client with DNI 20100100 should not be married to the client with DNI 11222333\n\n    Scenario: Marriage record is deleted when one of the clients involved is deleted\n        Given A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n        And A client with DNI 20100100, surname \"Garcia\", name \"Daisy\", born on \"2000-10-15\" and with address \"Cortina 223\"\n        And A new marriage on date \"2024-01-01\" between DNI 11222333 and DNI 20100100\n        When I delete the marriage of DNI 11222333\n        Then The client with DNI 11222333 should not be married\n        And The client with DNI 20100100 should not be married\n\n    Scenario: Cannot register marriage with one non-existent client\n        Given A non-existent client DNI like 5000000\n        And A client with DNI 20100100, surname \"Garcia\", name \"Daisy\", born on \"2000-10-15\" and with address \"Cortina 223\"\n        When I try to register a new marriage on date \"2024-01-01\" between DNI 5000000 and DNI 20100100\n        Then The operation should be denied due to non-existent spouse\n        And The client with DNI 20100100 should not be married\n\n    Scenario: Cannot register marriage when one client is already married\n        Given A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n        And A client with DNI 20100100, surname \"Garcia\", name \"Daisy\", born on \"2000-10-15\" and with address \"Cortina 223\"\n        And A client with DNI 21000000, surname \"Ferreira\", name \"Maria\", born on \"2002-06-10\" and with address \"Av. Acoyte 245\"\n        And A new marriage on date \"2024-01-01\" between DNI 11222333 and DNI 20100100\n        When I try to register a new marriage on date \"2024-01-02\" between DNI 20100100 and DNI 21000000\n        Then The operation should be denied due to a client involved already being married\n        And The client with DNI 11222333 should be married\n        And The client with DNI 20100100 should be married\n        And The client with DNI 21000000 should not be married","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///workspaces/2024_2C_109741_Ejercicio1/MeMo1-Ejercicio1/app/src/test/resources/memo1/ejercicio1/client-information-modification.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Modifying client information","description":"","children":[{"scenario":{"location":{"line":3,"column":5},"tags":[],"keyword":"Scenario","name":"Successfully modify client name","description":"","steps":[{"location":{"line":4,"column":9},"keyword":"Given ","text":"A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"","id":"ec46c42e-c42a-4ae2-ab16-92ba4aa18055"},{"location":{"line":5,"column":9},"keyword":"And ","text":" cicio1/deposit.feature","data":"Feature: Depositing money\n \n  Scenario: Successfully deposit money into an account through CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I deposit 200.0 into the account through CBU\n    Then The account balance should be 1200.0\n\n  Scenario: Successfully deposit money into an account through alias\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I deposit 200.0 into the account through alias\n    Then The account balance should be 1200.0\n\n  Scenario: Successfully create a transaction record when carrying out a deposit\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I deposit 200.0 into the account, on date \"2024-01-01\", at hour \"09:00:00\"\n    Then A new transaction record, with id 1, should be created\n    And Transaction with id 1 should have \"2024-01-01\" as date\n    And Transaction with id 1 should have \"09:00:00\" as hour\n    And Transaction with id 1 should have \"deposit\" as type of operation\n    And Transaction with id 1 should have 200.0 as amount\n    And Transaction with id 1 should have 123456789 as starter account CBU\n    And Transaction with id 1 should have 123456789 as target account CBU\n\n  Scenario: Cannot deposit a negative amount\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to deposit -100.0 into the account\n    Then The operation should be denied\n    And The account balance should remain 1000.0\n\n  Scenario: Cannot deposit a zero amount\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to deposit 0.0 into the account\n    Then The operation should be denied\n    And The account balance should remain 1000.0\n\n  Scenario: Cannot deposit into a non-existent account through CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A non-existent account CBU like 111122223\n    When I try to deposit 100.0 into the non-existent account through CBU\n    Then The operation should be denied\n\n  Scenario: Cannot deposit into a non-existent account through alias\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A non-existent account alias like \"iAmNotAccount\"\n    When I try to deposit 100.0 into the non-existent account through alias\n    Then The operation should be denied\n\n  Scenario: Transaction record is not created if deposit fails\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to deposit 200.0 into the account\n    Then The operation should be denied","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///workspaces/2024_2C_109741_Ejercicio1/MeMo1-Ejercicio1/app/src/test/resources/memo1/ejercicio1/deposit.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Depositing money","description":"","children":[{"scenario":{"location":{"line":3,"column":3},"tags":[],"keyword":"Scenario","name":"Successfully deposit money into an account through CBU","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","text":"A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"","id":"726aa596-0fd7-41eb-a31c-6ff896b67897"},{"location":{"line":5,"column":5},"keyword":"And ","text":"A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"","id":"e7b810fd-da2a-464d-82e1-a8e0635e4002"},{"location":{"line":6,"column":5},"keyword":"And ","text":"An account with CBU 123456789, alias \"iAmAccount\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1","id":"315240df-40a9-455e-852d-b8125be9e661"},{"location":{"line":7,"column":5},"keyword":"When ","text":"I deposit 200.0 into the account through CBU","id":"c5e46177-79a5-49e8-8dfe-59f1203b8 3ad94446327","timestamp":{"seconds":1730921747,"nanos":533711797},"willBeRetried":false}},{"source":{"uri":"file:///workspaces/2024_2C_109741_Ejercicio1/MeMo1-Ejercicio1/app/src/test/resources/memo1/ejercicio1/transfer-with-alias.feature","data":"Feature: Transferring money through alias\n \n  Scenario: Successfully transfer money from one account to another through alias\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I transfer 100.0 to the other account through alias, with DNI 11222333\n    Then The sender account balance should be 900.0\n    And The receiver account balance should be 1100.0\n\n    Scenario: Successfully create a transaction record when carrying out a transfer through alias\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I transfer 100.0 to the other account through alias, with DNI 11222333, on date \"2024-01-01\", at hour \"09:00:00\"\n    Then A new transaction record, with id 1, should be created\n    And Transaction with id 1 should have \"2024-01-01\" as date\n    And Transaction with id 1 should have \"09:00:00\" as hour\n    And Transaction with id 1 should have \"transfer\" as type of operation\n    And Transaction with id 1 should have 100.0 as amount\n    And Transaction with id 1 should have 123456789 as starter account CBU\n    And Transaction with id 1 should have 111222333 as target account CBU\n\n  Scenario: Cannot transfer more money than balance available through alias\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to transfer 1100.0 to the other account through alias, with DNI 11222333\n    Then The operation should be denied due to insufficient funds\n    And The sender account balance should remain 1000.0\n    And The receiver account balance should remain 1000.0\n\n  Scenario: Cannot transfer a negative amount through alias\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to transfer -100.0 to the other account through alias, with DNI 11222333\n    Then The operation should be denied\n    And The sender account balance should remain 1000.0\n    And The receiver account balance should remain 1000.0\n\n  Scenario: Cannot transfer a zero amount through alias\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to transfer 0.0 to the other account through alias, with DNI 11222333\n    Then The operation should be denied\n    And The sender account balance should remain 1000.0\n    And The receiver account balance should remain 1000.0\n\n  Scenario: Cannot transfer from one's account to the same one through alias\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And The same account as receiver\n    When I try to transfer 100.0 to the same account through alias, with DNI 11222333\n    Then The operation should be denied\n    And The sender account balance should remain 1000.0\n    And The receiver account balance should remain 1000.0\n\n  Scenario: Cannot transfer with not related DNI through alias\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to transfer 100.0 to the same account through alias, with DNI 10999222\n    Then The operation should be denied\n    And The sender account balance should remain 1000.0\n    And The receiver account balance should remain 1000.0\n\n  Scenario: Cannot transfer from non-existent account through alias\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A non-existent account CBU like 111122223\n    When I try to transfer 100.0 to the same account through alias, with DNI 11222333\n    Then The operation should be denied\n    And The sender account balance should remain 1000.0\n\n  Scenario: Cannot transfer to non-existent account through alias\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A non-existent account CBU like 111122223\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to transfer 100.0 to the same account through alias, with DNI 11222333\n    Then The operation should be denied\n    And The receiver account balance should remain 1000.0\n\n  Scenario: Transaction record is not created if transfer through alias fails\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11- U 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I transfer 100.0 to the other account through CBU, with DNI 11222333, on date \"2024-01-01\", at hour \"09:00:00\"\n    Then A new transaction record, with id 1, should be created\n    And Transaction with id 1 should have \"2024-01-01\" as date\n    And Transaction with id 1 should have \"09:00:00\" as hour\n    And Transaction with id 1 should have \"transfer\" as type of operation\n    And Transaction with id 1 should have 100.0 as amount\n    And Transaction with id 1 should have 123456789 as starter account CBU\n    And Transaction with id 1 should have 111222333 as target account CBU\n\n  Scenario: Cannot transfer more money than balance available through CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to transfer 1100.0 to the other account through CBU, with DNI 11222333\n    Then The operation should be denied due to insufficient funds\n    And The sender account balance should remain 1000.0\n    And The receiver account balance should remain 1000.0\n\n  Scenario: Cannot transfer a negative amount through CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to transfer -100.0 to the other account through CBU, with DNI 11222333\n    Then The operation should be denied\n    And The sender account balance should remain 1000.0\n    And The receiver account balance should remain 1000.0\n\n  Scenario: Cannot transfer a zero amount through CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to transfer 0.0 to the other account through CBU, with DNI 11222333\n    Then The operation should be denied\n    And The sender account balance should remain 1000.0\n    And The receiver account balance should remain 1000.0\n\n  Scenario: Cannot transfer from one's account to the same one through CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And The same account as receiver\n    When I try to transfer 100.0 to the same account through CBU, with DNI 11222333\n    Then The operation should be denied\n    And The sender account balance should remain 1000.0\n    And The receiver account balance should remain 1000.0\n\n  Scenario: Cannot transfer with not related DNI through CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to transfer 100.0 to the same account through CBU, with DNI 10999222\n    Then The operation should be denied\n    And The sender account balance should remain 1000.0\n    And The receiver account balance should remain 1000.0\n\n  Scenario: Cannot transfer from non-existent account through CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A non-existent account CBU like 111122223\n    When I try to transfer 100.0 to the same account through CBU, with DNI 11222333\n    Then The operation should be denied\n    And The sender account balance should remain 1000.0\n\n  Scenario: Cannot transfer to non-existent account through CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A non-existent account CBU like 111122223\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to transfer 100.0 to the same account through CBU, with DNI 11222333\n    Then The operation should be denied\n    And The receiver account balance should remain 1000.0\n  \n  Scenario: Transaction record is not created if transfer through CBU fails\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A sender account with CBU 123456789, alias \"iAmSender\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    And A receiver account with CBU 111222333, alias \"iAmReceiver\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to transfer 100.0 to the other account through CBU, with DNI 5000000\n    Then The operation should be denied\n    Then A new transaction record, with id 1, should not be created\n\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///workspaces/2024_2C_109741_Ejercicio1/MeMo1-Ejercicio1/app/src/test/resources/memo1/ejercicio1/transfer-with-cbu.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Transferring money through CBU","description":"","children":[{"scenario":{"location":{"line":3,"column":3},"tags":[],"keyword":"Scenario","name":"Successfully transfer money from one account to another through CBU","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","text":"A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"","id":"40156a0a-4aa5-447a-9f7d-5abfddec6dc3"},{"location":{"line":5,"column":5},"keyword":"And ","text":"A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"","id":"9bd67c4e-f226-4ee0-a43d-a1c6be4c73f9"},{"location":{"line":6,"column":5},"keyword":"And ","text":"A sender account with CBU 123456789, alias \"iAmSender\", ba with DNI 11222333\n    Then The account balance should be 700.0\n\n  Scenario: Successfully create a transaction record when carrying out a withdrawal\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I withdraw 200.0 from the account, with DNI 11222333, on date \"2024-01-01\", at hour \"09:00:00\"\n    Then A new transaction record, with id 1, should be created\n    And Transaction with id 1 should have \"2024-01-01\" as date\n    And Transaction with id 1 should have \"09:00:00\" as hour\n    And Transaction with id 1 should have \"withdrawal\" as type of operation\n    And Transaction with id 1 should have 200.0 as amount\n    And Transaction with id 1 should have 123456789 as starter account CBU\n    And Transaction with id 1 should have 123456789 as target account CBU\n\n\n  Scenario: Cannot withdraw more money than available balance\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to withdraw 1100.0 from the account through CBU, with DNI 11222333\n    Then The operation should be denied due to insufficient funds\n    And The account balance should remain 1000.0\n\n  Scenario: Cannot withdraw a negative amount\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to withdraw -10.0 from the account through CBU, with DNI 11222333\n    Then The operation should be denied due to insufficient funds\n    And The account balance should remain 1000.0\n\n  Scenario: Cannot withdraw a zero amount\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to withdraw 0.0 from the account through CBU, with DNI 11222333\n    Then The operation should be denied due to insufficient funds\n    And The account balance should remain 1000.0\n\n  Scenario: Cannot withdraw from a non-existent account through CBU\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A non-existent account CBU like 111122223\n    When I try to withdraw 100.0 from the non-existent account through CBU, with DNI 11222333\n    Then The operation should be denied\n\n  Scenario: Cannot withdraw from a non-existent account through alias\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And A non-existent account alias like \"iAmNotAccount\"\n    When I try to withdraw 100.0 from the non-existent account through alias, with DNI 11222333\n    Then The operation should be denied\n\n  Scenario: Transaction record is not created if withdrawal fails\n    Given A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"\n    And A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"\n    And An account with CBU 123456789, alias \"iAmAccount\", balance of 1000.0, with client of DNI 11222333 as owner and created by branch 1\n    When I try to withdraw 200.0 from the account, with DNI 5000000\n    Then The operation should be denied\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///workspaces/2024_2C_109741_Ejercicio1/MeMo1-Ejercicio1/app/src/test/resources/memo1/ejercicio1/withdraw.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Withdrawing money","description":"","children":[{"scenario":{"location":{"line":3,"column":3},"tags":[],"keyword":"Scenario","name":"Successfully withdraw money through CBU when the balance is sufficient","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","text":"A new branch with name \"Suc. Palermo\" and address \"Av. Lavalle 2500\"","id":"0831d22f-3d5e-4d52-b8b3-902a276f85d8"},{"location":{"line":5,"column":5},"keyword":"And ","text":"A client with DNI 11222333, surname \"Gregory\", name \"John\", born on \"1997-11-29\" and with address \"Av. Triunvitaro 557\"","id":"daa5657e-6ca2-4150-80d5-57d98fb030d5"},{"location":{"line":6,"column":5},"keyword":"And ","text":"An account with CBU 123456789, alias \"iAmAccount\", balance of 1000, with client of DNI 11222333 as owner and created by branch 1","id":"d13d44b1-a4dc-45aa-9bc4-09ca193f58f3"},{"location":{"line":7,"column":5},"keyword":"When ","text":"I withdraw 300.0 from the account through CBU, with DNI 11222333","id":"897b238d-cb22-4cde-a812-b2c8a0f5cb2d"},{"location":{"line":8,"column":5},"keyword":"Then ","text":"The account balance should be 700.0","id":"f2ca0954-0b54-4128-b237-777e403a30db"}],"examples":[],"id":"55bb319c-9deb-4b63-afc7-3
